import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';
import { MapContainer, TileLayer, Marker, Popup, useMap } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import L from 'leaflet';

// Define icon to fix the default marker issue
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-icon-2x.png',
  iconUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-icon.png',
  shadowUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-shadow.png',
});

const Finder = () => {
  const [code, setCode] = useState('');
  const [foundLocation, setFoundLocation] = useState(null);
  const [currentLocation, setCurrentLocation] = useState(null);
  const [errorMessage, setErrorMessage] = useState('');
  const mapRef = useRef();

  useEffect(() => {
    // Obter a localização atual do usuário
    if ('geolocation' in navigator) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          setCurrentLocation({
            latitude: position.coords.latitude,
            longitude: position.coords.longitude,
          });
        },
        (error) => {
          console.error('Erro ao obter localização:', error);
          setErrorMessage('Ocorreu um erro ao obter sua localização.');
        }
      );
    } else {
      setErrorMessage('Geolocalização não suportada pelo seu navegador.');
    }
  }, []);

  const handleFindLocation = async (event) => {
    event.preventDefault();

    try {
      // URL do Firebase Realtime Database
      const url = `https://geo-finder-7e641-default-rtdb.europe-west1.firebasedatabase.app/codes/${code}.json`;
      // Busca os dados no Firebase
      const response = await axios.get(url);

      // Verifica se encontrou os dados
      if (response.data && response.data.latitude && response.data.longitude) {
        const { latitude, longitude } = response.data;
        setFoundLocation({ latitude, longitude });
        setErrorMessage('');
        // Mover o mapa para a localização encontrada
        mapRef.current.flyTo([latitude, longitude], 13);
      } else {
        setFoundLocation(null);
        setErrorMessage('Código não encontrado.');
      }
    } catch (error) {
      console.error('Erro ao buscar código no Firebase:', error);
      setErrorMessage('Ocorreu um erro ao buscar o código. Por favor, tente novamente.');
    }
  };

  const goToCurrentLocation = () => {
    if (currentLocation) {
      mapRef.current.flyTo([currentLocation.latitude, currentLocation.longitude], 13);
    }
  };

  const goToFoundLocation = () => {
    if (foundLocation) {
      mapRef.current.flyTo([foundLocation.latitude, foundLocation.longitude], 13);
    }
  };

  return (
    <div>
      <h2>Localizador de Código</h2>
      <form onSubmit={handleFindLocation}>
        <label>
          Insira o Código:
          <input
            type="text"
            value={code}
            onChange={(e) => setCode(e.target.value)}
            required
          />
        </label>
        <button type="submit">Buscar Localização</button>
      </form>
      {errorMessage && <p style={{ color: 'red' }}>{errorMessage}</p>}
      {foundLocation && (
        <div>
          <h3>Localização Encontrada:</h3>
          <p>Latitude: {foundLocation.latitude}</p>
          <p>Longitude: {foundLocation.longitude}</p>
          <button onClick={goToFoundLocation}>Ir para localização encontrada</button>
        </div>
      )}
      {currentLocation && (
        <button onClick={goToCurrentLocation}>Ir para minha localização</button>
      )}
      {currentLocation && (
        <MapContainer
          center={[currentLocation.latitude, currentLocation.longitude]}
          zoom={13}
          style={{ height: '400px', width: '100%' }}
          whenCreated={(mapInstance) => { mapRef.current = mapInstance; }}
        >
          <TileLayer
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
          />
          <Marker position={[currentLocation.latitude, currentLocation.longitude]}>
            <Popup>Sua Localização Atual</Popup>
          </Marker>
          {foundLocation && (
            <Marker position={[foundLocation.latitude, foundLocation.longitude]}>
              <Popup>Localização Encontrada</Popup>
            </Marker>
          )}
        </MapContainer>
      )}
    </div>
  );
};

export default Finder;
